import Card from "react-bootstrap/Card";
import { NavLink } from "react-router-dom";
function ProductoCard({ producto }) {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src={producto.productoId.imagen} />
      <Card.Body>
        <Card.Title>
          <NavLink to={`/producto/${producto.id}`}>
            {producto.productoId.nombre}
          </NavLink>
        </Card.Title>
        <Card.Subtitle className="mb-2 text-muted">
          Marca: {producto.productoId.marcaId.nombre}
          <br></br>
          Categoria: {producto.productoId.categoriaId.nombre}
          <br></br>
          Unidad de Medida: {producto.productoId.unidadMedidaId.nombre}
        </Card.Subtitle>
      </Card.Body>
    </Card>
  );
}

export { ProductoCard };
